using GaleriaDavinci.Domain.Models;
using Microsoft.AspNetCore.Identity;
using Microsoft.AspNetCore.Identity.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore;
using System;

namespace GaleriaDavinci.Domain
{
    public class ApplicationDbContext : IdentityDbContext<ApplicationUser, ApplicationRole, string>
    {
        public DbSet<ArtPiece> ArtPieces { get; set; }
        public DbSet<Review> Reviews { get; set; }

        public ApplicationDbContext(DbContextOptions<ApplicationDbContext> options) : base(options)
        {
        }


        protected override void OnModelCreating(ModelBuilder builder)
        {
            ApplicationRole adminRole = new ApplicationRole(Guid.NewGuid().ToString(), SystemRoles.ADMIN);
            ApplicationRole authorRole = new ApplicationRole(Guid.NewGuid().ToString(), SystemRoles.AUTHOR);
            builder.Entity<ApplicationRole>().HasData(adminRole);
            builder.Entity<ApplicationRole>().HasData(authorRole);

            PasswordHasher<ApplicationUser> passwordHasher = new PasswordHasher<ApplicationUser>();
            var defaultAuthor = new ApplicationUser()
            {
                Id = Guid.NewGuid().ToString(),
                UserName = "author@author.com",
                Email = "author@author.com",
                NormalizedEmail = "author@author.com",
                NormalizedUserName = "author@author.com",
                EmailConfirmed = true,
                FirstName = "Vincent",
                LastName = "Van Gogh"
            };
            defaultAuthor.PasswordHash = passwordHasher.HashPassword(defaultAuthor, "tzx0yvh.mae-vmg8HMT");

            builder.Entity<ApplicationUser>().HasData(defaultAuthor);

            builder.Entity<IdentityUserRole<string>>().HasData(new IdentityUserRole<string> { UserId = defaultAuthor.Id, RoleId = authorRole.Id });

            builder.Entity<ArtPiece>().HasData(new ArtPiece
            {
                ID = 1,
                AuthorId = defaultAuthor.Id,
                Created = DateTime.Now,
                Modified = DateTime.Now,
                Name = "Mona Lisa",
                Description = "Primera obra de arte",
                Year = 1800,
                Url = "data:image/jpeg;base64,",
            });

            builder.Entity<ArtPiece>().HasData(new ArtPiece
            {
                ID = 2,
                AuthorId = defaultAuthor.Id,
                Created = DateTime.Now,
                Modified = DateTime.Now,
                Name = "El Grito",
                Description = "Segunda obra de arte",
                Year = 1900,
                Url = "data:image/jpeg;base64,",
            });

            base.OnModelCreating(builder);
        }
    }
}
